package ccxtpro
import ccxt "github.com/ccxt/ccxt/go/v4"
type Arkham struct {
   *ArkhamCore
   Core *ArkhamCore
   exchangeTyped *ccxt.Arkham
}

func NewArkham(userConfig map[string]interface{}) *Arkham {
   p := NewArkhamCore()
   p.Init(userConfig)
   return &Arkham{
       ArkhamCore: p,
       Core:  p,
       exchangeTyped: ccxt.NewArkhamFromCore(p.base),
   }
}


